import Head from 'next/head';

const Layout = (props) => (
  <div>
    <Head>
      <title>BitzPrice</title>
      <link rel="stylesheet" href="https://bootswatch.com/3/cerulean/bootstrap.min.css" />
    </Head>
    <Navbar />
  
    {props.children}  {/* this is where the pages live */}
  </div>
);

export default Layout;
